// get point per QBO unit
let pts_per_QBO_Unit = Object.fromEntries(
  {{ table3.data }}.map(r => [r.QBO_ID, r.QBO_Points/(r.QBO_Target - r.QBO_Beginning_Value)]));

// for each QPI, store its delta value & sum of all points
let pts_QPIs = Object.fromEntries({{ table9.data }}.map(r => [r.QPI_ID, [r.QPI_Target - r.QPI_Beginning_Value,0]]));

// for each QPI, sum up all the QBO points for all the QBOs it impacts in proportion to the QPI's impact on the QBO
{{ table6.data }}.forEach(r => pts_QPIs[r.QPI_Name][1] += pts_per_QBO_Unit[r.QBO_Name] * r.Expected_QBO_Impact)

// compute pts for jobs
let pts_Jobs = Object.fromEntries({{ table5.data }}.map(r => [r.Job_ID,0]));

// for each job, sum up all the QPI points for all the QPIs it impacts in proportion to the job's impact on the QPI
{{ table10.data }}.forEach(r => pts_Jobs[r.Job_Title] += pts_QPIs[r.QPI_Name][1]/pts_QPIs[r.QPI_Name][0] * r.QPI_Impact)

return pts_Jobs;

const org_Job = {{ table5.selectedRow }};
// const org_Job = {{ table5.data.find(r => r.Job_ID === JobToBeDuplicatedIDVariable.value) }};
const { Job_Points,...dup_Job } = org_Job;
return {...dup_Job, 'Job_ID': {{ DuplicatedJobIDVariable.value }} };

const org_Job = {{ JobToBeDuplicatedIDVariable.value }};
return {{ table10.data }}.filter(row => row.Job_Title === org_Job).map(r => ({...r, 'Job_QPI_Mapping_ID': uuid.v4(), 'Job_Title': {{ DuplicatedJobIDVariable.value }} }));
// this will not work as new duplicate Job ID isn't available in Job2PI table still

// Create object to store current QPI progress
let progress_QPIs = Object.fromEntries({{ table9.data }}.map(q => [q.QPI_ID,[q.QPI_Name, 0]]));

// get all done Jobs titles
let done_Jobs = {{ getDoneJobsTransformer.value }}.map(j => j.Job_ID);

// filter Job2QPI table for only done jobs
let done_Jobs_Impact = {{ table10.data }}.filter(r => done_Jobs.includes(r.Job_Title));

// for each entry in done Jobs impact, accumulate its points in corresponding QPI
done_Jobs_Impact.forEach(e => progress_QPIs[e.QPI_Name][1] += e.QPI_Impact)

// divide the accumulated points by diff. b/w target & beginning value
{{ table9.data }}.forEach(q => progress_QPIs[q.QPI_ID][1] /= (q.QPI_Target - q.QPI_Beginning_Value))

//return Object.fromEntries(Object.values(progress_QPIs));    
return progress_QPIs;

// store QBO progress values
let progress_QBOs = Object.fromEntries({{  table3.data.map(r => [r.QBO_ID, [r.QBO_Name,0]])}});

// get current  QPI progress
let current_progress_QPIs = {{ getQPICurrentPercentProgressTransformer.value }};

// update QBO progress based on QPI current progress & its impact
{{table6.data}}.forEach( r => progress_QBOs[r.QBO_Name][1] += r.Expected_QBO_Impact * current_progress_QPIs[r.QPI_Name][1]);

// finally get percentages progress for QBOs
{{table3.data}}.forEach(r => progress_QBOs[r.QBO_ID][1] /= (r.QBO_Target - r.QBO_Beginning_Value));

return progress_QBOs;

